import Link from 'next/link'

export const PostPreview = ({ post }) => {
  const {
    link,
    module: { meta }
  } = post

  return (
    <article>
      <span>{meta.date}</span>
      <Link href={'/blog' + link}>
        <a>{meta.title}</a>
      </Link>
    </article>
  )
}
